import ReactDOM from 'react-dom';
import axios from 'axios';
import React, { useEffect, useState} from "react";
import { useHistory} from "react-router-dom";
import NavBar from '../NavBar';



function Automobiliai() {

    const history = useHistory();
    const token = localStorage.getItem('auth_token')

    if(token == null){
        history.push('/prisijungimas')
    }

    const [state, setData] = useState({
        auto: null
    });

    const fetchData = async () => {
        const api = await fetch("api/automobiliai",{
            method: 'get',
            headers: new Headers({
                'Authorization': 'Bearer' + token
            })
        });
        setData({
            auto: await api.json(),
        });
    };


    useEffect(() => {
        fetchData();
    }, [])

    return (
        <div className="sb-nav-fixed">
            <NavBar />
        <div className="container">
            <div className="row justify-content-center">
                <div className="col-md-8">
                    <div className="card">
                        <div className="card-header">Automobiliai</div>
                        <table>
                        <thead>
                        <tr>
                                    <th>Id</th>
                                    <th>Pavadinimas</th>
                                    <th>Marke</th>
                                    <th>Kuras</th>
                                </tr>
                                </thead>


                            <tbody>
                              {
                                state?.auto?.map(autom => (
                                    <tr key={autom?.id}>
                                    <td>{autom?.id}</td>
                                    <td>{autom?.pavadinimas}</td>
                                    <td>{autom?.marke}</td>
                                    <td>{autom?.kuras}</td>
                                </tr>
                                ))
                            }
                            </tbody>
                            </table>
                    </div>
                </div>
            </div>
        </div>
        </div>
    );
}

export default Automobiliai;

if (document.getElementById('automobiliai')) {
    ReactDOM.render(<Automobiliai />, document.getElementById('automobiliai'));
}
